import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './App.css'
const Leaderboard = () => {
    const [teams, setTeams] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:5002/leaderboard')
            .then(response => {
                setTeams(response.data);
            })
            .catch(error => {
                console.error(error);
            });
    }, []);

    return (
        // <table className='container-fluid'>
