            <tr>
                <td class="number">5</td>
                <td class="name">Johnny Suh</td>
                <td class="points">258.208</td>
            </tr> */}
            </table>
            <div id="buttons">
            <button class="exit">Exit</button>
            <button class="continue">Continue</button>
            </div>
        </div>
        </main>
        </>
    );
};

export default Leaderboard;
